  <style>
    body {
      background-color: #343a40;
      color: #fff;
    }

    .gradient-overlay {
      background: radial-gradient(ellipse at top, rgba(10, 14, 18, 0.8), rgba(10, 14, 18, 0.4));
      position: absolute;
      top: 0;
      bottom: 0;
      left: 0;
      right: 0;
      z-index: -1;
      position: fixed;
    }

    #drop-area {
      width: 100%;
      height: 700px;
      border: 2px dashed #ccc;
      border-radius: 20px;
      display: flex;
      align-items: center;
      justify-content: center;
      font-size: 20px;
      color: #ccc;
      margin-top: 50px;
    }

    #drop-area.hover {
      border-color: #fff;
      color: #fff;
    }

    #file-content {
      margin-top: 20px;
      word-break: break-all;
    }

    #contacts {
      margin-top: 50px;
    }
  </style>

  <script>
    // Get reference to the drop area
    const dropArea = document.getElementById("drop-area");
    const fileContent = document.getElementById("file-content");

    // Prevent default behaviors
    ["dragenter", "dragover", "dragleave", "drop"].forEach((eventName) => {
      dropArea.addEventListener(eventName, preventDefaults, false);
    });

    function preventDefaults(e) {
      e.preventDefault();
      e.stopPropagation();
    }

    // Highlight the drop area when item is dragged over
    ["dragenter", "dragover"].forEach((eventName) => {
      dropArea.addEventListener(
        eventName,
        () => {
          dropArea.classList.add("hover");
        },
        false
      );
    });

    // Remove highlight when item is dragged away
    ["dragleave", "drop"].forEach((eventName) => {
      dropArea.addEventListener(
        eventName,
        () => {
          dropArea.classList.remove("hover");
        },
        false
      );
    });

    // Handle dropped files
    dropArea.addEventListener("drop", handleDrop, false);

    function handleDrop(e) {
      const dt = e.dataTransfer;
      const files = dt.files;
      handleFiles(files);
    }

    function handleFiles(files) {
      [...files].forEach((file) => {
        if (file.type === "audio/wav") {
          convertToBase64(file);
        } else {
          alert("Only WAV files are supported.");
        }
      });
    }

    function convertToBase64(file) {
      const reader = new FileReader();
      reader.readAsDataURL(file);
      reader.onloadend = () => {
        const base64String = reader.result.split(",")[1]; // Get the base64 string without the prefix
        displayFileContent(file.name, base64String);
        saveVitalFile(base64String);
      };
    }

      const contentDiv = document.createElement("div");
      contentDiv.innerHTML = `<strong>${fileName}:</strong> ${base64String}`;
      fileContent.appendChild(contentDiv);
    }
